import React, { FC, useEffect } from "react";
import Layout from "./components/Layout/Layout";
import { BrowserRouter as Router } from "react-router-dom";
import { gets3Client } from "./utils/videoUploadUtils";

const App: FC = () => {
  useEffect(() => {
    gets3Client();
  }, []);
  return (
    <Router>
      <Layout />
    </Router>
  );
};

export default App;
